1	1	Agus	2022-06-21 13:23:53	Lincah, stabil, aman	Sienta sgt lincah sbg sebuah city car dgn kestabilan yg sgt baik. Tampilan eksterior ckp mewah. Interior bagus mski krg nyaman utk penumpang di baris kedua apalagi ketiga. Utk angkut barang lumayan luas, dan yg plg unik dari Sienta, pas sekali buat angkut sepeda buat yg hobby sepeda.   Sbg sebuah city car dgn penggerak roda depan harap maklum kalau di tanjakan krg begitu bertenaga. Konsumsi BBM jgn harap sama dgn Avanza. Tpi msh irit di kecepatan dibawah 100 km/jam (1:14 - tol).   Kalau soal stabil mobil ini dijamin ga bakal limbung. Stabil skali mski di kecepatan tinggi. Handling jga ok. Fun to drive. Fitur keselamatan ABS-nya berfungsi maksimal. Otomatis, air bag jga bsa dihandalkan. Fitur keselamatan ini yg plg pnting. Apalagi utk yg srg pk keluar kota via tol.   Sound system nya jga lumayan ok plus head unit yg sdh support BT Sound dan mirroring. Kecepatan? Dgn Pertalite, Sienta sanggup di 170 km/jam. Diisi Pertamax bsa mentok speedometer (180 km/jam). Dan jgn khawatir limbung. Nyaris tdk terasa sama sekali. Ini keunggulan Sienta dibanding rival rival nya.   Minus : Boros BBM di kecepatan diatas 100km/jam (1:10); sandaran penumpang tdk ada arm rest spt di Honda Freed; material plastik; ban serep ukuran kecil; cat tipis gampang bocel kalau kecelatan kerikil.  Overall, value for money..	4
2	1	Aji	2022-06-21 13:22:53	Underrated JDM MPV	Pemakai Sienta Q CVT '16.  Desain mungkin tidak mudah dicerna oleh pasar Indonesia, tentu karena Sienta awalnya dibuat untuk Japan Domestic Market. Bagi yang suka vibe jepang, cocok banget. Masuk ke dalam, desain dashboardnya meski tetap unik, namun khas Jepang, dia tetap praktis, ergonomis, dan mengedepankan fungsi. Cup holder besar di tiap sisi baris depan, siap diisi botol air atau satu cup long black untuk menemani perjalanan.   Baris kedua tidak bisa dibilang relatif sempit karena sebagai MPV ruang kepalanya tetap sangat luas, namun mungkin akan kecewa dengan fleksibilitas konfigurasinya. Jarak maju-mundur kursi tengah bahkan tidak ada 1/3 nya perubahan jarak kursi Calya: sangat minim. Yes, tidak ada captain seat. Well, saya bukan kapiten juga anyway. Justru menurut saya disesuaikan saja dengan kebutuhan, jok model memanjang itu sangat berguna untuk anak jika ingin tiduran dan untuk orangtua yang mobilitasnya sudah berkurang, bergesar dari sisi satu ke lainnya akan lebih mudah. Kenyamanan? Tentu jauh di atas LMPV. Arm rest? Bantal adalah solusi. Doble blowernya manusiawi dan adil. Karena beberapa merek memberikan double blower model split di atap namun kisi penyembur udaranya hanya diberikan 3 kisi. Di Sienta ada 4. Namun, perlu diingat, jika Anda mencari unit bekas pakai, di usianya yang tidak lagi muda, siap-siap ekspektasi kekurangan semua MPV berpintu geser: bunyi-bunyi di sekitaran pintu gesernya.   Posisi paling belakang, joknya relatif tipis tapi posisi duduknya paling manusiawi dibanding di LMPV. Karena pelipatan kursinya yang disimpan di bawah jok baris kedua, maka posisi kaki menjorok ke bawah dan areanya sangat luas. Ini tidak membuat penumpang dewasa cepat lelah. Posisi bangku di belakang juga dapat diubah 1 step lebih rebah dan semakin menambah kenyamanan.  Mesin 1.5 ltr yang sama digunakan Vios dan Yaris "lele" ditempatkan melintang berpenggerak roda depan. Pemakaian dalam kota rute pendek dan banyak berhenti, konsumsi bbmnya bisa berada di 1:9. Sementara untuk perjalanan di jalan tol dengan kecepatan sesuai batas maksimum kecepatan tol, dia bisa mendapatkan. 1:18. Untuk tipe Q, mesin tersebut dipasangkan dengan CVT bermode manual 7 percepatan. Hasilnya: surprisingly sporty. Pernah kami membawanya perjalanan jarak jauh Jawa-Bali, ketika diajak berkelok di Taman Nasional Baluran Situbondo, respon CVT mode manualnya dan karakter kaki-kakinya membuat Sienta sangat asik dikendarai, di luar ekspektasi MPV kotak yang semula dipikir limbung. Electronic Power Steeringnya juga lumayan cerdas mengikuti kebutuhan dan kecepatan mobil. CVTnya unik dan pintar, dia bahkan di mode full auto ada semacam tahapan virtual yang meniru perpindahan gigi transmisi manual. Jadi tidak seperti CVT lain yang saat kick down akan menahan putaran mesin di rpm maksimal sehingga kesannya seperti mengejan.   Tanjakan juga kuat kok, saat dibawa dari Ubud ke Panglipuran, kami diarahkan gmaps ke jalab kecil dan terdapat tanjakan curam. CVT nya mampu menahan rpm saat mode manual gigi 1 sehingga kuat menanjak padahal diisi 4 dewasa dan 2 anak ditambah roofrack. Jauh beda dari pengalaman reviewer atas mobil-mobil ber CVT baru-baru ini yang memperlihatkan CVT nya tidak memperkenankan mobil menanjak.  Tipe Q '16 sudah mendapatkan ABS, EBD, dan HSA. Plus kontrol stabilitas elektronik yang lebih menambah keamanan. Airbag juga sama persis Fortuner seangkatannya: 3 airbag depan. Rem cakram di keempat roda. Lampu LED dengan pengaturan ketinggian otomatis. Oh ya, ban serepnya space saver.  Kekurangan: Paling mengganggu adalah radius putar. Ini levelnya adalah level membuat orang di sekitaran berfikir Anda baru belajar menyetir. Ya, lagi-lagi bukan kapiten, tapi radius putarnya macam kapal tanker. Tentu ini dilebih-lebihkan. Tapi dengan ukuran semungil itu, harusnya bisa lebih baik. Apa lagi tipe Q yang memakai ban lebih besar,  dia memerlukan sekurangnya 5.7m radius putar balik.  Lainnya, sementara ini selalu ada solusi untuk semua kendala yang ditemui. Partsnya banyak kesamaan dengan Toyota lainnya, jadi meskipun tidak terjual banyak dibanding Toyota lainnya, Sienta mudah perawatannya.	5
3	1	Idedz harsoyo	2022-06-18 10:07:27	MPV kecil mewah nyaman untuk aktivitas harian	Tidak menyesal beli mobil ini untuk pemakaian harian di Jakarta. Fitur sliding door otomatis,lampu HID, CVT,HU kenwood, jok lipat, model keren yang sangat nggak pasaran. Ngga percuma ini mobil termasuk best seller di Jepang. Sering PP Jkt-Bandung via tol japex, suspensinya nyaman banget, jauh lebih nyaman daripada avanza apalagi rush. Tanjakan gedong songo Semarang tembus kok..isi sekeluarga besar.  Sebelumnya memang agak lemot di tanjakan, namun setelah di upgrade pake filter sienta/yaris Facelift (2020), tenaga putaran atas lebih ngisi, karna napasnya lebih dingin. Untuk mobil yg lebih all around dalam dan luar kota sih mungkin naik kelas ke innova Q yah..	5
