e yang jauh lebih rendah.  Oh iya, somehow kami merasa profil ban yang lebih besar akan lebih cocok di sini karena bodi Xpander yang terlihat berlebih besar ketika dibandingkan velg dan bannya.  Suspensi XpanderJenis suspensi yang dipakai Xpander adalah MacPherson Strut di depan dan Torsion Beam di belakang (Carmudi Indonesia/Rosano) Putaran setir tergolong ringan, meski karena balutan kulit di lingkarnya, rasa mengenggamnya termasuk mantap. Feedback-nya termasuk akurat untuk kecepatan rendah sampai medium. Terasa effortless, namun tidak sampai hambar seperti Confero S.  Meski di kecepatan tinggi di atas 100 km/jam, deadzone akan jauh lebih banyak, butuh cukup banyak koreksi dan putarannya menjadi terlalu ringan.  Apakah buruk untuk sebuah Low MPV? Sama sekali tidak. Apalagi, radius putarnya tergolong lumayan kompak di 5,2 meter mengingat bodinya yang lebih panjang dibanding kompetitor.  Soal peredaman suara, kami harus takjub di sektor ini karena Mitsubishi melakukan PR-nya dengan benar. Suara mesin 4N91 teredam dengan sempurna, tetap tenang bahkan di atas 100 km/jam. Suara ban Bridgestone Ecopia berdiameter 16 incinya pun minim yang masuk ke kabin, apalagi suara dari luar yang terbukti dari seberapa beratnya suara pintu saat ditutup.  Nice!  Terakhir, bagaimana soal konsumsi bahan bakar?  Tampaknya, Mitsubishi mengambil jalan aman dengan mesin 4N91 ini. Meski unit lawas, namun karakternya cenderung mengembalikan konsumsi bahan bakar yang irit.  Mengitari Jakarta lebih dari 200 km dengan kecepatan rata-rata 21 km/jam misalnya, konsumsi bahan bakar yang tercantum di MID tidak jauh-jauh dari 11 km/liter. Bila jalan lebih kondusif, kami yakin mencapai angka di atas 15 km/jam tidak akan terlalu sulit.	5
