118	33	Rahmat	2022-06-16 04:29:28	Review alphard 2020 yang semakin gahar	Review Toyota Alphard 2020  Toyota sebagai raksasa otomotif asal Jepang ini merilis Alphard dan Vellfire untuk kalangan eksekutif. Keduanya hadir dengan beberapa perbedaan sesuai segmen pengguna masing-masing. Alphard menonjolkan desain dengan nuansa formal dan dinamis sehingga cocok untuk digunakan kalangan pejabat negara. Sementara itu, Vellfire menonjolkan kesan cool, modern, dengan kesan berani yang ditujukan kepada kalangan pengusaha atau selebriti.  Kalangan pengusaha ataupun pejabat memakai Alphard karena mampu memenuhi kebutuhan mereka sebagai kantor berjalan. Alasannya, MPV boxy keluaran toyota ini menyuguhkan kenyamanan dengan beragam fitur pendukung produktivitas saat bekerja. Tidak jarang, pengguna Alphard melanjutkan pekerjaan mereka di mobil ketika dalam perjalanan. Toyota Alphard ini menyediakan seluruh kebutuhan yang diinginkan kalangan kelas atas. Tidak heran, bila kemewahan pada Alphard sebenarnya merupakan alternatif kendaraan pengganti sedan saloon keluaran merek Jepang atau bahkan Eropa sekalipun.  Toyota Alphard resmi masuk ke Indonesia pada tahun 2002 dan menjadi pelopor di segmen MPV premium. Sebab, pada saat itu segmen MPV mewah di Indonesia belum banyak pesaing sejenis dari merek lain. Toyota Alphard awalnya dibuat khusus untuk pasar domestik Jepang, tetapi karena diminati oleh konsumen Asia, Alphard lantas dijual di beberapa negara lainnya, termasuk di Indonesia. Selain di Indonesia, Alphard juga dipasarkan di Bahrain, Bangladesh, Belarusia, China, Hong Kong, India, Oman, Filipina, Rusia, Singapura, Malaysia, Taiwan dan Thailand. Alphard sempat memiliki versi Royal Lounge Alphard yang merupakan versi mewah dimana interiornya hanya berkonfigurasi dengan empat kursi. Toyota juga membuat versi yang lebih sporty dari Alphard, dengan nama Vellfire.  Toyota terinspirasi memakai nama Alphard yang berasal dari nama bintang paling terang dalam konstelasi Hydra. Kemudian menurut pakar astronomi Eropa, mereka menyebut Alphard sebagai rasi bintang Cor Hydrae atau The Heart of the Snake. Inilah alasan mengapa memakai logo ular pada grill depan Alphard, dan tidak menggunakan logo Toyota. Alphard mengutamakan kenyamanan kabin dengan berbagai fitur kelas satu yang sangat memanjakan. Toyota memang menciptakan Alphard untuk memenuhi kebutuhan kalangan atas di Asia yang terbiasa dengan MPV. Mobil dengan wujud minibus ini pastinya punya kapasitas angkut yang besar dan juga dimensi yang lega.  Memasuki tahun 2008, hadir varian Vellfire yang saat itu mengisi tipe teratas dalam keluarga Alphard yang kemudian terpisah dimana Vellfire menjadi model tersendiri. Kini, Alphard telah masuk generasi ketiga dengan membawa sejumlah perubahan. MPV boxy ini bisa dikenali dari headlamp sipit, lalu desain grille yang besar dan mirip Crown.  Segmentasi Pasar Toyota Alphard 2020  Dengan ragam fitur mumpuni, kenyamanan mobil yang mengesankan dan fitur keselamatan yang lengkap, Alphard menjadi MPV terlaris di Jepang. Alphard sukses memikat kalangan kelas atas di kawasan Asia dengan keunggulan dimensi kabin yang super lega. Hingga 2008, Toyota Indonesia hanya menyediakan Alphard sebagai MPV flagship. Dengan hadirnya Vellfire, karakter konsumen MPV boxy bisa semakin luas dan Alphard kini ditujukan bagi kalangan pejabat negara. Di Indonesia, Toyota merilis generasi ketiga Alphard pada 26 Januari 2015 lalu dengan tampilan, fitur, dan mesin baru 2.500cc bensin dan 2.500cc liter hybrid.  Itu karena desain Alphard yang menonjolkan kemewahan, elegan, kalem dan berwibawa. Namun secara kelengkapan, baik Alphard atau Vellfire dibekali fitur yang nyaris sama persis. Khusus untuk Alphard, kini tersedia dalam tipe 3.5 Q yang merupakan tipe tertinggi dan terbaik bagi Toyota Indonesia. Toyota Alphard menawarkan konsep mobil mewah terbaik Indonesia dengan kemewahan tak tertandingi. Alphard juga telah menjadi sebuah simbol prestise tersendiri bila menggunakannya. Tak perlu resah bila dilanda kemacetan Jakarta misalnya, kenyamanan Toyota Alphard akan seketika menghilangkan kepenatan karena beragam fasilitas mewah yang ada di interiornya.  Hadirnya tipe 3.5 Q selaras dengan keinginan pengguna Alphard yang menginginkan sebuah MPV premium bergaya elegan, fitur terbaik, serta mesin yang sangat bertenaga dan responsif. Tipe 3.5 Q ini masuk dalam ukuran wah apabila hanya dipakai sebagai mobil harian kalangan pengusaha atau sosialita.  Eksterior Toyota Alphard 2020  Toyota Alphard generasi ketiga mudah dikenali dari desain headlamp dan grill besar. Di bagian depan, Alphard memakai empat buah headlamp LED yang terintegrasi dengan lampu kabut. Desain sipit milik Alphard ini cantik dan elegan dan lantas digunakan pada model Toyota lainnya seperti Voxy hingga Avanza. Grill trapesium berukuran besar dengan aksen krom memancarkan kesan mahal dan elegan. Desain bumper menyesuaikan rancangan grille serta fog lamp bezel yang lekuknya mengikuti alur desain headlamp.  Perbedaan desain dengan Vellfire yaitu pada headlamp dan grill dimana untuk Vellfire terpisah antara lampu utama dan DRL untuk lampu senja. Selain itu, bilah grill pada Vellfire juga hanya tiga buah dengan ukuran sangat besar berikut logo Toyota di tengah. Bila dilihat sekilas, desain grill pada Toyota Alphard ini ada kemiripan dengan Crown. Bisa disimpulkan, Alphard ini merupakan alternatif bagi konsumen Toyota Crown yang butuh mobil lebih besar ketimbang sedan.  Toyota juga masih mempertahankan desain garis pilar B hingga ke generasi Alphard terbaru. Ciri khas lain yang bisa kita kenali dari Alphard yaitu desain floating roof mulai dari pilar C hingga ke belakang. Kemudian di bagian belakang, pemasangan LED membuat kesan mewah semakin terpancar di bodi Toyota Alphard yang besar.  Interior Toyota Alphard 2020  Interior Alphard memang memiliki daya tarik tersendiri karena menyajikan kenyamanan dan kemewahan ala limousine. Penumpang disuguhkan dengan captain seat istimewa karena memakai legrest dan bergaya ottoman. Maksudnya, sudut kemiringan kursi ini bisa diatur nyaris rebah sehingga mirip seperti di kasur. Fitur ini sangat memanjakan kalangan pebisnis maupun pejabat dengan mobilitas tinggi. Saat kaki tidak lekas lelah dalam perjalanan jauh tinggal rebahkan saja reclining seat dan kemudian naikkan legrest. Apabila butuh  Pada kursi depan, kita bisa melihat konsep Delightful Journey dengan ciri khas ornamen kayu (Brown Wood) pada dashboard di tipe 2.5 X, 2.5 G. Sementara itu pada tipe 3.5 Q lebih mewah lagi, dashboard warna hitam dipercantik wood panel dengan aksen brown olive ash burl wood grain. Untuk menjaga privasi di kabin, mobil seharga lebih dari Rp 1 miliar ini telah dilengkapi dengan tirai di kaca belakang.  Sebagai mobil kelas atas, kabin Alphard tentunya harus memiliki berbagai fitur terbaik. Penumpang bisa menikmati sinar matahari pagi hanya dengan membuka panoramic sunroof. Penumpang di kursi baris kedua dan ketiga bisa menikmati fasilitas hiburan melalui layar LCD yang berada di atap. Roof monitor ini bahkan telah mendukung Blue Ray Player dengan koneksi screen mirroring dari smartphone anda lewat aplikasi Miracast. Kualitas sound system yang jempolan ini didukung speaker keluaran JBL.  Toyota Alphard dibekali head unit canggih terintegrasi LCD 10 inch untuk penumpang baris kedua. Head unit ini mendukung berbagai menu pilihan berupa entertainment system, DVD Player, dan navigasi. Semakin nyaman, Dual Climate A/C Control with Captive Touch memudahkan penumpang dalam mengatur suhu dalam kabin sesuai selera.  Aksesibilitas masuk ke kabin juga sangat mudah, karena memakai pintu geser dan ground clearance Alphard yang kini lebih rendah 10 milimeter. Pintu yang besar dan pijakan rendah memudahkan lansia masuk atau keluar dari kabin Alphard.  Pengguna dari kelas atas tentunya telah memakai smartphone canggih pula. Untuk itu, Alphard memiliki fitur wireless charging yang terletak konsol tengah. Dengan begini, kita tidak perlu repot mengeluarkan kabel charging dari tas untuk mengisi daya smartphone. Bagi pengguna yang super sibuk dan harus menyelesaikan pekerjaan selama perjalanan, fasilitas meja kecil di balik fixed armrest tentunya bisa untuk menyangga laptop atau sekedar berkas-berkas. Kalangan pejabat negara kian betah melakukan perjalanan bila memakai Alphard 3.5 Q karena memakai penghangat kursi. Pengemudi juga ikut dimanjakan dengan penghangat setir dan instrument panel yang lebih lengkap.  Spesifikasi Mesin dan Performa Toyota Alphard 2020  Toyota Alphard dibekali mesin 2.500 cc dengan tenaga 180 Ps, yang juga dipakai Toyota Camry. Sementara itu tipe 3.5 Q dibekali mesin lebih besar, mesin 3.500 cc berkonfigurasi V6 menghasilkan tenaga 276 Ps didukung transmisi automatic 6 percepatan. Konsumsi bahan bakar Alphard lumayan irit, mesin 2.5 liter berkisar antara 10-12 km/liter untuk rute kombinasi. Dengan tangki bensin terisi penuh, maka Alphard mampu mampu menempuh jarak antara 750-900 kilometer.  Bicara soal kenyamanan, Toyota ketimbang memasang suspensi udara malah tetap menggunakan suspensi konvensional yang dipasang pada Alphard. Kemampuan peredam guncangan pada Alphard tidak bisa disepelekan karena tak kalah nyaman dengan suspensi balon. Mcpherson Strut with Torsion Beam dipasang di depan dan Double Wishbone with Torsion Beam untuk bagian belakang.  Fitur Keamanan dan Keselamatan Toyota Alphard 2020  Sebagai mobil kelas atas, Toyota Alphard jelas memiliki fitur keselamatan jempolan dan tergolong komplit. Anti-lock braking system (ABS), brake assist (BA), electronic brake-force distribution (EBD), variable track control system (VCS), plus 7 airbag semua tersedia sebagai fitur standar.  Kelebihan dan Kekurangan Toyota Alphard 2020  Kelebihan yang dimiliki Toyota Alphard adalah jaminan layanan servis yang tersebar di seluruh jaringan dealer Toyota di Indonesia. Nama besar Toyota juga memudahkan pemilik Alphard yang membeli dari pihak importir umum jika terjadi kerusakan.  Selain itu, kenyamanan Alphard salah satu yang tidak tertandingi di pasaran. Mobil ini sering dijadikan sebagai sebuah simbol status seseorang. Kalangan menteri, pejabat negara, pengusaha, hingga ke selebriti dan sosialita memilih Alphard sebagai mobil harian mereka.  Adapun kelemahan yang dimiliki Toyota Alphard yang dijual di pasar adalah dari sisi harga yang terbilang masih mahal. Padahal kini telah banyak mobil bikinan merek lain dengan fitur yang sama dengan Toyota Alphard di Indonesia. Bobot mobil yang relatif berat juga turut menguras tenaga mesin yang tak terlalu besar.  Nissan Serena, hingga Hyundai H-1, Honda Elysion dan Nissan Elgrand juga memiliki fitur yang tak kalah ciamik. Dari sisi harga, beberapa diantara model itu jauh lebih ekonomis ketimbang Toyota Alphard.	5
