194	58	Rahmat	2022-06-05 10:52:07	Review Daihatsu Sigra 2019 (Rival Calya Agya)	Review Spesifikasi, Kelebihan dan Kekurangan Daihatsu Sigra - MPV LCGC Mungil yang Irit Daihatsu Sigra - Daihatsu Sigra merupakan MPV LCGC berukuran mungil yang dibekali dengan mesin yang kecil juga. Tersedia varian mesin 1.0L dan 1.2L yang juga digunakan pada New Agya/Ayla. Persaingan di segmen ini masih diisi dengan sedikit kompetitor, seperti Toyota Calya dan Datsun Go+ Panca. Penjualan Toyota Sigra menyasar kalangan kelas menengah kebawah yang membutuh MPV yang murah dan juga irit. Dimensi yang kecil juga menjadi solusi bagi pemilik rumah dengan ukuran garasi yang terbatas.  Sebagai MPV LCGC , Daihatsu Sigra diposisikan satu level di bawah kelas Daihatsu Xenia. Meskipun satu level di bawah Xenia, Daihatsu Sigra yang dibangun dari sebuah hatchback terasa cukup nyaman bahkan dinilai lebih nyaman daripada Daihatsu Terios. Oleh karena itu, banyak komentar positif mengenai mobil ini dan diprediksi penjualan MPV LCGC (baik Daihatsu Sigra maupun Toyota Calya, karena masih 1 basis dan kenyamanannya sama) ini mampu mengungguli penjualan di segmen Small MPV seperti Toyota Avanza dan Daihatsu Xenia di kalangan menengah kebawah.  Eksterior Daihatsu Sigra  Meskipun termasuk dalam MPV LCGC dan harganya relatif terjangkau, desain eksterior yang diusung Daihatsu Sigra tergolong menarik. Dilihat sekilas, bentuknya seperti anakan dari Grand New Kijang Innova/Innova Reborn. Pada bagian depan, terlihat lekukan-lekukan yang terlihat sporty. Tidak terlihat seperti kebanyakan mobil murah. Sepasang headlampnya juga memiliki sudut-sudut tajam yang sporty, dilengkapi juga sepasang foglamp di bagian bawah yang dikelilingi aksen chrome. Grillnya cukup lebar dan di bagian atasnya juga terdapat sebuah garis dengan aksen chrome dengan emblem Sigra di tengahnya.  Pada bagian bagian samping, terlihat bagian fender kurang spesial karena terlalu minimalis dan kurang aksesoris. Baiknya, ruang fender mobil ini tidak terlihat cingkrang  meskipun hanya menggunakan velg 14 inch berbalut ban 175/65 (kecuali tipe D). Selisih antara fender dan ban tidak terlalu jauh membuatnya terlihat menarik namun kandas ketika diisi muatan penuh. Desain kaca samping sudah cukup bagus dengan desain yang menyempit ke belakang. Ground clearance setinggi 180 mm cukup mumpuni untuk MPV berdimensi kecil ini.  Untuk tipe R, bagian belakang menganut desain stoplamp vampire back, yaitu berupa huruf L terbalik yang juga diusung oleh Grand New Kijang Innova. Tipe R sebagai tipe terlengkap juga sudah dibekali dengan rear parking sensors dan aksesoris pemanis tambahan berupa garis berwarna chrome di bagian atas dudukan plat nomor. Dibalik desainnya yang terbilang menarik di kelasnya, sebagai sebuah LCGC tentu plat body yang digunakan masih terasa cukup tipis.  Spesifikasi Eksterior Panjang: 4070 mm Lebar 1655 mm Tinggi: 1600 mm Wheelbase: 2525 mm Jarak Pijak Roda Depan: 1470 mm Jarak Pijak Roda Belakang: 1475 mm Ground Clearance: 180 mm Radius Putar 4.5 meter Net Weight: 990 kg Ukuran Ban dan Velg: 175/65 R14 (untuk tipe D 155/80 R13)  Interior Daihatsu Sigra  Interior Daihatsu Sigra didesain dengan skema warna two-tone hitam dan beige. Meskipun material pada panel dasbor masih menggunakan plastik tipis ala LCGC, desain yang diusung cukup menarik dengan model asimetris (desain yang sama dengan Toyota Calya). Tuas perseneling terletak pada bagian dasbor untuk menambah keleluasaan pada kabin bagian depan. MID tersedia pada instrumen speedometer untuk menunjukan berbagai informasi seperti konsumsi BBM, oddometer, tripmeter, dsb. Untuk fitur multimedia dibekali dengan Head Unit 2-Din tanpa touchscreen. Steering wheel menggunakan model 3-spoke namun belum dilengkapi dengan Audio Control Switch. Untuk fitur keselamatan, turut disematkan dua buah airbag pada bagian pengemudi dan penumpang depan. Meskipun bagian belakang juga memiliki lubang ventilasi AC, secara teknis mobil ini masih manganut single blower yang dihembus