uk, tidak juga terlalu keras. Sebagian orang menilai bahwa mobil ini lebih nyaman dari Daihatsu Xenia, bahkan jauh lebih nyaman dari Daihatsu Terios yang harganya jauh lebih mahal. Berkat basis hatchback yang diadopsikan pada Daihatsu Sigra, handlingnya cukup baik lincah dan tergolong stabil, meskipun tidak terlalu spesial. Selain itu radius putar yang hanya 4.5 meter, memudahkan untuk putar balik dan memarkirkan MPV mungil ini di tempat parkir yang sempit.  Spesifikasi Mesin dan Suspensi Engine 1.0: 1.0 KR-VE DOHC VVT-i Engine 1.2: 1.2 NR-VE DOHC Dual VVT-i Konfigurasi 1.0: 3 in-line cylinder, 12 valve Konfigurasi 1.2: 4 in-line cylinder, 16 valve Tenaga Maks 1.0: 66 HP @6000 rpm Tenaga Maks 1.2: 87 HP @6000 rpm Torsi Maks 1.0: 89 Nm @4400 rpm Torsi Maks 1.2: 108 Nm @4200 rpm Konsumsi BBM: 19-14km/l (dalkot) dan 16-19 km/l (lukot) Kapasitas Tangki Bahan Bakar: 36 liter Steering: Rack & Pinion with EPS Penggerak: Roda Depan (FWD) Transmisi: 5-Speed MT / 4-Speed AT Suspensi Depan: MacPherson Strut with Coil Spring Suspensi Belakang: Torsion Beam with Coil Spring Rem Depan: Ventilated Disc Rem Belakang: Drum  Kelebihan dan Kekurangan Daihatsu Sigra  Kelebihan: - Konsumsi BBM irit - Perawatan mudah dan murah - Pajak murah - Harga relatif murah - Tersedia varian murah dengan mesin 1.0L - Kabin lega - Bagasi besar dan bangku ketiga dapat dilipat  Kekurangan: - Plat body tipis - Material interior kurang bagus - Tenaga kecil - Kandas ketika muatan penuh - Varian 1.0L minim fitur	4
