udio Steering Control - Tilt Steering - Digital Auto AC - MID - Eco Indicator - Leather Seats - Engine Start/Stop Button - Projector Headlights - LED DRLs - LED Rear Combination Lamps - Roof Rail - Retractable Electric Mirrors - Rear Parking Camera - Dual Front SRS Airbags - ABS - EBD - Brake Assist - VSA (Stability Control) - Hill Start Assist - Isofix - Keyless Entry - Engine Immobilizer - Alarm System  Performa Honda BR-V Facelift 2019 Honda BR-V dibekali dengan mesin yang masih sama, L15Z1 i-VTEC SOHC berkapasitas 1500 cc yang merupakan mesin yang juga digunakan pada mobil Honda 1500 cc lainnya. Mesin ini mampu menghasilkan tenaga maksimum sebesar 120 PS pada putaran mesin 6600 rpm dan torsi puncak sebesar 145 Nm pada putaran mesin 4600 rpm. Tenaga dan torsinya disalurkan ke roda depan melalui transmisi manual 6-percepatan atau otomatis CVT.  Mesin ini masih memiliki output yang sama dengan versi sebelum facelift. Jadi, performa-nya juga sama persis. Terasa halus di putaran bawah, dan cukup galak di putaran atas. Konsumsi BBM-nya juga relatif irit. Performanya memang tidak seresponsif Mobilio yang bermesin sama, namun touring di jalan tol terasa lebih mengasyikan dibandingkan dengan Rush/Terios. Sebelum munculnya DFSK Glory 560, mesin ini merupakan mesin yang paling powerful di kelas LSUV 7-seater.  Performa Mesin Mesin: 1.5L L15Z1 i-VTEC SOHC Konfigurasi: 4 silinder segaris, 16 katup Kubikasi: 1497 cc Rasio Kompresi: 10.3:1 Bore x Stroke: 73 x 89.4 mm Tenaga Maks: 120 PS / 6600 rpm Torsi Maks: 145 Nm / 4600 rpm Bahan Bakar: Gasoline Sistem Bahan Bakar: PGM-FI Konsumsi BBM: 8-12 km/l (dalkot), 12-18 (lukot) Kapasitas Tangki BBM: 42 liter Steering: Rack & Pinion (EPS) Transmisi: 6-speed M/T, CVT Drive System: FWD (Penggerak Roda Depan)  Handling dan Kenyamanan Honda BR-V Facelift 2019 Sebenarnya tidak ada yang perlu dibahas untuk handling dan kenyamananya mengingat settingan suspensinya tidak berubah. Honda BR-V masih menjadi yang paling fun to drive di segmen in