d clearance pun juga lebih tinggi 20 mm, membuat LSUV ini mampu menerjang genangan air yang lebih tinggi dari versi MPV-nya.  Review dan Spesifikasi Suzuki XL7, LSUV Hasil Crossover dari Ertiga Bagian belekang juga tak banyak berubah dari Ertiga. Desain lampu belakang LED masih serupa. Bagian body di atas garis chrome dan dibawah kaca belakang kini berwarna hitam, apapun warna mobilnya. Bagian atap dilengkapi dengan spoiler yang sporty, namun agak berlebih dan terkesan memaksa bagi sebagian orang. Di bagian bawahnya, terlihat pelindung underguard garnish berbahan plastik dengan warna silver yang sama dengan bagian depan.  Spesifikasi Eksterior Lampu Utama: Full LED Lampu Kabut: Halogen DRL: LED Lampu belakang: LED Spion: Electric Retract Roof-rail: Yes Aksesoris: Overfender, underguard garnish, spoiler Antena: Short Pole Model Kamera Mundur: Ada, plus e-Mirror dengan kamera depan dan belakang Sensor Parkir: Ada Velg: 16" Alloy Wheel, Dual Tone Ban: 195/60 R16  Dimensi Panjang: 4450 mm Lebar: 1775 mm Tinggi: 1710 mm Wheelbase: 2740 mm Front Tread: 1515 mm Rear Tread: 1530 mm Ground Clearance: 200 mm Radius Putar: 5.1 meter  Baca Juga: Review dan Spesifikasi Mitsubishi Xpander Cross  Interior Suzuki XL7 Berbedan dengan Ertiga, Suzuki XL7 membawakan nuansa warna full hitam untuk kabinnya. Memang desainnya masih sama persis, namun ini bukan hal yang buruk. Aksen wooden panel di dashboard milik Ertiga digantikan dengan aksen carbon yang memang lebih cocok untuk aura hitamnya. Bentuk stir yang sama juga menandakan hal positif. Desain flat bottom dengan adanya pengatur audio di roda kemudi merupakan pilihan yang sesuai.  Bicara soal fitur, semua kelengkapan Ertiga ditanamkan juga di XL7. Mulai dari head unit model semi-foating, AC digital, Engine Start/Stop Button, dual airbags, ABS, EBD, hingga stability control (ESP). Fitur tambahan yang unik ada pada spion tengah yang disebut sebagai e-Mirror. Fitur ini dapat difungsikan sebagai spion tengah biasa, kamera belakang, serta kamera depan. Jadi total kamera yang dimiliki oleh Suzuki XL7 ada 3 yaitu, kamera e-mirror depan, e-mirror belakang, serta kamera parkir. Selain itu, e-mirror ini juga bisa digunakan sebagai Dashcam/DVR.  Soal akomodasi, ruang kabin yang disediakan Suzuki XL7 masih sama dengan Ertiga. Ruang kaki dan ruang kepala cukup memadai di seluruh baris. Pengaturan sliding di baris kedua juga memungkinkan untuk membagi ruang kaki baris kedua dan baris ketiga sesuai kebutuhan. Selain itu, jok baris kedua dan ketiga bisa dilipat rata lantai untuk tidur atau bawa barang. Posisi duduk cukup nyaman dan empuk dengan balutan kulit yang dikombinasikan dengan fabric. Posisi mengemudinya juga cukup ergonomis dan fleksibel meskipun pengaturan stir hanya ada tilt tanpa teleskopik.   Spesifikasi Interior Kapasitas Penumpang: 7 orang Warna Interior: Hitam Material Dashboard: Plastik (Hard Plastic) Material Jok: Kulit dengan fabric Pengaturan Jok: Manual, 6-arah untuk driver Pengaturan Stir: Hanya tilt  Kelengkapan Fitur - 8" Semi-Floating Touchscreen Head Unit - Steering Wheel Audio Control - Tilt Steering - Color MID - Engine Start/Stop Button - Digital AC Climate Control - e-Mirror with Front and Rear Camera + DVR/Dashcam - All Row 12V Power Outlet - Cup Holder with Chiller - LED DRL - LED Headlights - High-Mounted Stoplamp - Roof-rail - Electric Retractable Side Mirrors - ISOFIX - Dual SRS Airbags - ABS - EBD - Electronic Stability Programme - Hill Hold Control - Keyless Entry System - Immobilizer - Alarm System  Performa Suzuki XL7 Suzuki XL7 juga dibekali mesin yang sama dengan kode K15B VVT DOHC berkapasitas 1500 cc yang menghasilkan tenaga 104.7 PS pada putaran mesin 6000 rpm dengan torsi puncak sebesar 138 Nm pada putaran mesin 4000 rpm. Output tenaga dan torsi ini disalurkan ke roda depan melalui transmisi manual 5-percepatan atau otomatis 4-percepatan.  Dengan mesin yang sama, karakter mesin yang terasa pada Suzuki XL7 ini tentu sama dengan Ertiga. Memang, ground clearance dan wajah depan yang berbeda akan memberikan nilai aerodinamika yang berbeda. Namun, perbedaan ini tidak menunjukan selisih performa dan efisiensi yang signifikan. Bahkan tidak terasa untuk penggunaan sehari-hari.  Spesifikasi Mesin dan Transmisi Mesin: 1.5L K15B VVT DOHC Konfigurasi: 4 silinder segaris, 16 katup Kubikasi: 1462 cc Bore x Stroke: 74 x 85 mm Rasio Kompresi: 10.5:1 Tenaga Maks: 104.7 PS / 6000 rpm (77 kW) Torsi Maks: 138 Nm / 4000 rpm Bahan Bakar: Bensin Sistem Bahan Bakar: Multipoint Injection Konsumsi BBM: 9-14 km/l (dalkot), 13-18 km/l (lukot) Kapasitas Tangki BBM: 45 liter Steering: Rack & Pinion Transmisi: 5-speed M/T, 4-speed A/T Drive System: Penggerak Roda Depan (FWD)  Handling dan Kenyamanan Suzuki XL7 Untuk urusan handling, Suzuki XL7 ini cukup baik dan lincah bermanuver di dalam kota. Bodyroll memang terasa ketika menikung, namun masih dalam batas aman dan masih cukup stabil. Karakter bantingan suspensi juga relatif empuk. Kesan berkendaranya masih hampir sama dengan Ertiga meskipun ground clearance-nya lebih tinggi. Hal ini tentu masih wajar, mengingat ground clearance Suzuki XL7 ini masih lebih rendah dari LSUV lainnya seperti Mitsubishi Xpander Cross, Honda BR-V, serta Daihatsu Terios/Rush.  Spesifikasi Kaki-kaki Sasis: Monokok Suspensi Depan: MacPherson Strut Suspensi Belakang: Torsion Beam Rem Depan: Ventilated Disc Rem Belakang: Drum  Kelebihan: - Akselerasi halus - Konsumsi BBM relatif irit - Imbang antara handling dan kenyamanan - Jok tebal dan empuk - Fitur fitur lumayan lengkap dengan e-mirror dan 3 kamera - Kabin cukup kedap (masih kalah dengan Xpander) - Harga kompetitif dibandingkan rivalnya  Kekurangan: - Putaran bawah kurang galak - Ground clearance terendah di kelasnya meskipun sudah memadai - Desain samping dan belakang masih mirip Ertiga - Tidak ada pengaturan teleskopik pada stir - Brand image	5
